import useFetch from "../hooks/useFetch";

export default function Home() {
  const { data, error, loading } = useFetch(
    "http://localhost:1337/api/projects"
  );

  console.log(data);

  return (
    <main>
      <Hero />
      <About />
      <Featured />
    </main>
  );
}
